import React from 'react';

function Contact() {
  return (
    <div className="contact">
      <h1>Contact Us</h1>
      <p>Email: hello@rosie.com</p>
      <p>Phone: +1 234 567 8900</p>
    </div>
  );
}

export default Contact;
